class InstagramAPI:
    
    def __init__(self, username: str):
        self.username = username
        self.api_url = f"https://www.instagram.com/api/v1/users/web_profile_info/?username={username}"
        self.headers = {
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/120.0.0.0 Safari/537.36',
            'X-IG-App-ID': '936619743392459',
            'Accept-Language': 'tr-TR,tr;q=0.9,en-US;q=0.8,en;q=0.7',
            'Origin': 'https://www.instagram.com',
            'Referer': f'https://www.instagram.com/{username}/',
            'DNT': '1'
        }
        self.profil_verisi: Optional[Dict[str, Any]] = None
        
    def profil_bilgisi_al(self) -> bool:
        try:
            response = requests.get(self.api_url, headers=self.headers, timeout=15)
            
            if response.status_code == 404:
                self._hata_mesaji("Kullanıcı bulunamadı!")
                return False
                
            response.raise_for_status()
            
            self.profil_verisi = response.json()
            
            if "data" in self.profil_verisi and "user" in self.profil_verisi["data"]:
                return True
                
            self._hata_mesaji("Geçersiz yanıt alındı")
            return False
                
        except requests.exceptions.RequestException as e:
            self._hata_mesaji(f"API Hatası: {str(e)}")
            return False
        except json.JSONDecodeError:
            self._hata_mesaji("Geçersiz JSON yanıtı alındı")
            return False
    
    def _hata_mesaji(self, mesaj: str) -> None:
        print(f"\n{Fore.RED}⛔ {mesaj}{Style.RESET_ALL}")
    
    def _baslik_yazdir(self, baslik: str) -> None:
        print(f"\n{Fore.MAGENTA}┌{'─'*58}┐")
        print(f"│ {Fore.CYAN}{baslik.upper():^56} {Fore.MAGENTA}│")
        print(f"└{'─'*58}┘{Style.RESET_ALL}")
    
    def _bilgi_satiri(self, etiket: str, deger: Any, renk: str = Fore.WHITE) -> None:
        print(f"{Fore.YELLOW}│ {Fore.GREEN}{etiket:<25}{Fore.YELLOW}: {renk}{deger:>28} {Fore.YELLOW}│")
    
    def bilgileri_goster(self) -> None:
        if not self.profil_verisi:
            self._hata_mesaji("Profil verisi alınamadı!")
            return
            
        kullanici = self.profil_verisi["data"]["user"]
        
        os.system('cls' if os.name == 'nt' else 'clear')
        
        print(f"\n{Fore.YELLOW}{'_'*60}")
        print(f"|{Fore.CYAN}{'INSTAGRAM PROFİL ANALİZİ':^58} {Fore.YELLOW},|")
        print(f"|{'_'*60}|")
        
        self._bilgi_satiri("Kullanıcı", kullanici['username'], Fore.CYAN)
        self._bilgi_satiri("Tam Ad", kullanici['full_name'], Fore.CYAN)
        
        print(f"{Fore.YELLOW}╟{'─'*60}╢")
        
        self._bilgi_satiri("Takipçi", f"{kullanici['edge_followed_by']['count']:,}", Fore.LIGHTGREEN_EX)
        self._bilgi_satiri("Takip", f"{kullanici['edge_follow']['count']:,}", Fore.LIGHTGREEN_EX)
        self._bilgi_satiri("Gönderi", f"{kullanici['edge_owner_to_timeline_media']['count']:,}", Fore.LIGHTGREEN_EX)
        
        print(f"{Fore.YELLOW}╟{'─'*60}╢")
        
        self._bilgi_satiri("Doğrulanmış", '✅ Evet' if kullanici['is_verified'] else '❌ Hayır')
        self._bilgi_satiri("Gizli", '✅ Evet' if kullanici['is_private'] else '❌ Hayır')
        
        if kullanici['biography']:
            bio = kullanici['biography'].replace('\n', ' ')
            self._bilgi_satiri("Biyografi", bio[:40] + '...' if len(bio) > 40 else bio)
        
        print(f"{Fore.YELLOW}╚{'═'*60}╝\n")
        
        self._baslik_yazdir("Ek Bilgiler")
        if kullanici.get('business_email'):
            self._bilgi_satiri("İş E-postası", kullanici['business_email'])
        
        if kullanici.get('external_url'):
            self._bilgi_satiri("Harici Link", kullanici['external_url'])
        
        self._json_kaydet(kullanici)
    
    def _json_kaydet(self, veri: Dict[str, Any]) -> None:
        kaydet = input(f"{Fore.YELLOW}📂 Profil bilgilerini kaydetmek ister misiniz? (e/h): {Style.RESET_ALL}").lower()
        if kaydet == 'e':
            dosya_adi = f"instagram_{self.username}_{datetime.now().strftime('%Y%m%d_%H%M%S')}.json"
            try:
                with open(dosya_adi, 'w', encoding='utf-8') as f:
                    json.dump(veri, f, ensure_ascii=False, indent=4)
                print(f"\n{Fore.GREEN}✅ Profil bilgileri '{dosya_adi}' olarak kaydedildi.{Style.RESET_ALL}")
            except IOError as e:
                self._hata_mesaji(f"Dosya yazma hatası: {str(e)}")

def ana_menu() -> None:
    os.system('cls' if os.name == 'nt' else 'clear')
    print(f"│ {Fore.CYAN}{'INSTAGRAM PROFİL SORGU':^58} {Fore.YELLOW}")
    print(f"├{'─'*60}┤")
    print(f"│ {Fore.WHITE}Geliştirici: {Fore.CYAN}@Zerooo1_1{'':>30} {Fore.YELLOW}")
    print(f"│ {Fore.WHITE}Kanal: {Fore.CYAN}@Rolex_Checkerr{'':>35} {Fore.YELLOW}")
    print(f"└{'─'*60}┘{Style.RESET_ALL}")

def main():
    ana_menu()
    
    while True:
        username = input(f"\n{Fore.CYAN}🔍 Instagram kullanıcı adı (Çıkmak için 'q'): {Style.RESET_ALL}")
        
        if username.lower() == 'q':
            print(f"\n{Fore.YELLOW}👋 Çıkış yapılıyor...{Style.RESET_ALL}")
            sys.exit(0)
            
        if not username.strip():
            print(f"{Fore.RED}⚠ Lütfen geçerli bir kullanıcı adı girin!{Style.RESET_ALL}")
            continue
            
        print(f"\n{Fore.BLUE}⌛ Profil bilgileri alınıyor...{Style.RESET_ALL}")
        
        insta = InstagramAPI(username)
        
        if insta.profil_bilgisi_al():
            insta.bilgileri_goster()
        else:
            print(f"{Fore.RED}⛔ Kullanıcı bulunamadı veya profili gizli!{Style.RESET_ALL}")
        devam = input(f"\n{Fore.YELLOW}🔄 Başka bir kullanıcı sorgulamak ister misiniz? (e/h): {Style.RESET_ALL}").lower()
        if devam != 'e':
            print(f"\n{Fore.YELLOW}👋 Program sonlandırıldı.{Style.RESET_ALL}")
            break

if __name__ == "__main__":
    try:
        main()
    except KeyboardInterrupt:
        print(f"\n{Fore.RED}⏹ Program kullanıcı tarafından durduruldu.{Style.RESET_ALL}")
        sys.exit(1)
        
